stems. The HRA is available online, in English and Spanish. A print-based version of the assessment is available, if needed. Personal feedback can be viewed on-screen or through a printed report. Insert NCQA logo here.\n\nValidated Readiness to Change Assessment \nUnlike other health risk assessments, ours uses validated questions to assess readiness to change leading health risks and provides immediate feedback on the most important behavior change strategies based on empirically derived decision rules.\n\nEvidence-based Personal Feedback Report \nOur personal feedback report provides evidence-based, stage-matched feedback about the single most important strategy individuals can use to make progress on that specific behavior.\nEach time a user completes the survey, their feedback is updated to reflect change since the previous assessment. The report suggests online and community resources through which participants can learn more.\u00a0Our assessment provides an overall Personal Health Report\u00a0participants can share with their health care provider.\n\nHRA Features\n In addition to health risks such as smoking, unhealthy eating, sedentary behavior, depression, and ineffective stress management, our evidence-based Survey also assesses:\n\u2022 Current health conditions\n\u2022 Adherence to United States Preventive Services Task Force recommendations for age and gender appropriate screenings and immunizations\n\u2022 Productivity and well-being\n\n", "category": "Programs & Services", "embedding": [0.12650364585804552, 0.8476232978304746, 0.21709038274231762, 0.5996386956482471, 0.9723643335086013, 0.7698914728733721, 0.21753833788283206, 0.7558706676818826, 0.6811039989843584, 0.41333408809765926, 0.0008676134552838555, 0.29500983829532623, 0.7975005330568953, 0.38669029447738223, 0.8090464876851845, 0.8189247927615514, 0.9389383378645584, 0.13451626230954605, 0.2794274335916842, 0.3428788871531153, 0.6971769825591034, 0.6948255160854935, 0.7478244653688478, 0.33 olicy to have a clear understanding of client satisfaction with programs, services and personnel, and to implement changes designed to increase satisfaction when appropriate. Below is a summary of the procedure we follow:\n1) Account Management Reports\na) Bi-annual Account Management Report\ni) Twice per year, Account Managers complete a report for each of their clients that includes satisfaction\nratings as well as narrative regarding particular barriers and successes.\nii) The Account Management reports are sent to the Vice President of Quality Management.\nb) Weekly Account Management Reports\ni) On a weekly basis, the Account Managers prepare a report on client activity.\nii) The Vice President of Quality Management is included in the distribution list for these weekly reports.\n2) Reporting to the Quality Management Committee (QMC)\na) The Director of Quality Management receives the information noted above and produces a bi-annual summary\nthat is documented on the QMC Performance Monitoring report.\nb) The summary report is presented to the QMC by the Vice President of Quality Management.\nc) Based on the review and recommendations of the QMC:\ni) Corrective Action Plans (CAP) will be initiated when needed to address areas of concern.\nii) If indicated, the application of a formal quality improvement project (QIP) will be applied.", "category": "Providers & Clinical Services", "embedding": [0.9055877567955694, 0.9533658596536043, 0.6155516239632239, 0.899967782357336, 0.5319378946026254, 0.3810780165608274, 0.6827351312756424, 0.7603682840803087, 0.3657858173335119, 0.3542374725690033, 0.87298627786091, 0.7681521169259704, 0.7475313663716583, 0.4699082972921952, 0.45538235244296976, 0.5962053586525637, 0.5409277872439963, 0.3865377680027331, 0.33580844778846963, 0.324616516445825, 0.1204703384541913, 0.46057810943712774, 0.07270609416144436, 0.7998451271661151, 0.8531917871232996, 0.8269844878890296, 0.7556386307160171, 0.29060914117299497, 0.4963560597761768 name and title.\n2)\u00a0\u00a0\u00a0Welcome the participant and share the name of the program and where you are calling from (HMC HealthWorks).\n\u2022 Provide participant with an explanation of how/why they are eligible for program participation. Include client specific incentive or disincentive information if applicable.\u00a0\u00a0\n\u2022 Provide verbal program overview.\u00a0\n\u2022 Upon request, email or mail document to participant.\n3)\u00a0\u00a0\u00a0Provide reason for the call including length of call and expectations.\u00a0\nInclude the following:\n\u2022 The objective of the program is to support individuals in making healthy lifestyle changes.\n\u2022 Through active participation in the program, participants can improve health outcomes.\n\u2022 There is no cost to participate.\n\u2022 PHI (personal health information) is kept according to HIPAA standards.\n\u2022 The program is confidential.\u00a0 Individual health information is not shared with the union or employer. This information is only available to the fund or third-party administrator (TPA) who has access to consumer health information in order to receive and pay claims for services rendered.\n\u2022 Confidentiality is extended to the HMC HealthWorks' team of coaches including Nurse Health Advocates, wellness coaches, psychologists, psychiatrist, and the medical director. Consultation within the team occurs as situations outside the realm of expertise of the coach arise.\n\u2022 Confidentiality is limited if there is mention of harm to self, others or abuse.\u00a0\n\u2022 Coaching calls are periodically randomly monitored or recorded for quality purposes and training.\n\u2022 Participants have the right to discontinue, change coaches, or register a complaint at any time by calling HMC HealthWorks' toll free number (provide participant with the client specific toll free number) .\n\u2022 Details of participant rights and responsibilities can be emailed or mailed if requested by participant.\n\     function fakeEmbed(text) {
      let seed = Math.abs(Array.from(text).reduce((a, c) => a + c.charCodeAt(0), 0)) % 10000;
      return Array(1536).fill(0).map((_, i) => Math.sin(seed * (i + 1)) % 1);
    }

    function cosineSimilarity(a, b) {
      let dot = 0, normA = 0, normB = 0;
      for (let i = 0; i < a.length; i++) {
        dot += a[i] * b[i];
        normA += a[i] ** 2;
        normB += b[i] ** 2;
      }
      return dot / (Math.sqrt(normA) * Math.sqrt(normB));
    }

      let queryVec = fakeEmbed(query);
      return data

          const vectorScore = cosineSimilarity(queryVec, entry.embedding);
          const score = vectorScore + keywordScore * 3;
          return { ...entry, score, keywordScore };
